  return(
    <div className="container">
      <div className="card-container">
        <div className="card"> 
          <figure className="card-front">
            <img alt="" src={imageUrl} />
            <h1>Hi</h1>
          </figure>
          <figure className="card-back">
            <h1>Hello</h1>
          </figure>
        </div>
      </div>
    </div>
  );
};

export default ProductCard; 
